PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE facultiescsv (
faculty TEXT NOT NULL,
building TEXT NOT NULL,
room TEXT NOT NULL,
capacity INTEGER NOT NULL,
lecturer_email TEXT NOT NULL,
lecturer_firstname TEXT NOT NULL,
lecturer_surname TEXT NOT NULL,
PRIMARY KEY (faculty, building, room, lecturer_email)
);
CREATE TABLE studentscsv (
student_firstname TEXT NOT NULL,
student_surname TEXT NOT NULL,
studentID INTEGER NOT NULL,
year INTEGER NOT NULL,
address TEXT NULL,
contact_number TEXT NULL,
moduleID TEXT NOT NULL,
module_name TEXT NOT NULL,
leader TEXT NOT NULL,
lecturer1 TEXT NULL,
lecturer2 TEXT NULL,
exam_mark INTEGER NULL,
coursework1 INTEGER NULL,
coursework2 INTEGER NULL,
coursework3 INTEGER NULL,
PRIMARY KEY (studentID, moduleID)
);
COMMIT;
